import "./App.css";
import HomePage from "./Homepage/Homepage";
import Navbar from "./Components/Navbar/Navbar";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Monday from "../src/Pages/Monday";

const App = () => {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route component={"hey"} />
          <Route
            exact
            path="/"
            component={
              <>
                <h1> yo </h1>
              </>
            }
          />
          <Route exact path="/Theron" component={<h1> theorn </h1>} />
        </Switch>
      </Router>
    </div>
  );
};

export default App;
